import Datepicker from "react-tailwindcss-datepicker";
import { FaFileDownload } from "react-icons/fa";

const Transactions = () => {
  const [value, setValue] = useState({ 
    startDate: new Date(), 
    endDate: new Date().setMonth(11) 
    }); 

    const handleValueChange = (newValue) => {
    console.log("newValue:", newValue); 
    setValue(newValue); 
    } 
  return (
    <>
        <section>
            <div className="h-screen bg-gradient-to-r from-slate-500 to-yellow-100">
              <p className="text-left p-10 text-2xl font-semibold">Transactions</p>
              <div className='flex'>
                <div className='w-[450px] pl-10 flex'>
                  <Datepicker 
                    value={value} 
                    onChange={handleValueChange} 
                  />
                  <button type="button" class="text-gray-900 ml-3 bg-gradient-to-r from-red-200 via-red-300 to-yellow-200 hover:bg-gradient-to-bl focus:ring-4 focus:outline-none focus:ring-red-100 dark:focus:ring-red-400 font-medium rounded-lg text-sm px-5 py-2.5 text-center mr-2 mb-2">Apply</button>
                </div>
                <div className='flex bg-slate-100 cursor-pointer items-center ml-[400px] space-x-3 mr-2 font-semibold bg-gradient-to-r from-slate-500 via-slate-700 to-slate-900 text-gray-100 rounded-md px-6 py-2 hover:bg-white hover:text-white hover:ring-slate-300 mx-8 shadow-lg shadow-slate-800/100'>
                  <FaFileDownload />
                  <p>Statement</p>
                </div>
              </div>

              <div>
                ritesh
              </div>
            </div>
        </section>
    </>
  )
}

export default Transactions
